          // }
          // if (i == 7) {
          //   boxLists[4].style.setProperty("background-position-x", 600 + "px");
          //   boxLists[4].querySelectorAll(".Double27p-item-img").forEach((child) => {
          //     child.style.setProperty("display", "block");
          //   });
            
          // }
